import { Link } from "react-router-dom";

function TeacherList() {
  return (
    <div id="page-teacher-list" className="container">
      <header className="page-header">
        <div className="top-bar-container">
          <Link to="/"></Link>
        </div>
      </header>
    </div>
  );
}

export default TeacherList;
